INSERT INTO `tblspeciality` VALUES (1,'Accident and emergency medicine','Specializing in the immediate care of patients with acute injuries or illnesses.','Handles cases like trauma, accidents, and sudden medical emergencies.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(2,'Allergology','Deals with the diagnosis and treatment of allergic reactions and diseases.','Focuses on identifying and managing allergies and immunologic disorders.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(3,'Anaesthetics','Specializes in providing anesthesia and pain relief during medical procedures.','Works closely with surgical teams to ensure patients are comfortable and pain-free.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(4,'Biological hematology','Studies the anatomy, physiology, and pathology of blood and blood-forming tissues.','Includes research on blood diseases, transfusion medicine, and hematopoiesis.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(5,'Cardiology','Focuses on the diagnosis and treatment of heart-related conditions and diseases.','Covers areas such as heart disease, heart failure, and cardiac surgery.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(6,'Child psychiatry','Specializes in the mental health care of children and adolescents.','Addresses emotional and behavioral disorders in young individuals.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(7,'Clinical biology','Applies principles of biology to the practice of medicine.','Includes laboratory work to analyze and interpret medical data.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(8,'Clinical chemistry','Studies the chemical processes within the body to aid in the diagnosis and treatment of diseases.','Involves analyzing blood and other bodily fluids for chemical composition.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(9,'Clinical neurophysiology','Studies the function of the central and peripheral nervous systems through recording and analyzing electrical activities.','Includes procedures like EEG and nerve conduction studies.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(10,'Clinical radiology','Uses medical imaging techniques to diagnose and treat diseases.','Includes X-rays, CT scans, MRIs, and other imaging modalities.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(11,'Dental, oral and maxillo-facial surgery','Specializes in surgical procedures involving the mouth, teeth, and facial structures.','Includes dental extractions, jaw surgery, and facial reconstructions.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(12,'Dermato-venerology','Focuses on the study and treatment of diseases of the skin, hair, and nails.','Addresses conditions like dermatitis, psoriasis, and sexually transmitted infections.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(13,'Dermatology','Specializes in the diagnosis and treatment of skin disorders.','Covers conditions such as acne, eczema, and skin cancer.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(14,'Endocrinology','Deals with disorders of the endocrine system and hormones.','Addresses conditions like diabetes, thyroid disorders, and hormonal imbalances.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(15,'Gastro-enterologic surgery','Focuses on surgical procedures involving the digestive tract and related organs.','Includes procedures like gastric bypass, hernia repair, and colorectal surgery.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(16,'Gastroenterology','Specializes in the diagnosis and treatment of digestive system disorders.','Covers conditions such as irritable bowel syndrome, Crohn\'s disease, and liver diseases.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(17,'General hematology','Deals with the study, diagnosis, treatment, and prevention of diseases related to the blood.','Covers conditions such as anemia, blood clotting disorders, and leukemia.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(18,'General Practice','Provides primary healthcare to individuals and families.','Addresses a wide range of medical conditions and coordinates patient care.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(19,'General surgery','Performs surgical procedures on various parts of the body.','Includes procedures like appendectomy, hernia repair, and gallbladder surgery.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(20,'Geriatrics','Focuses on the health and care of elderly individuals.','Addresses the unique medical needs and challenges of older adults.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(21,'Immunology','Studies the immune system and its functions.','Includes research on immune responses, immunodeficiency, and autoimmune diseases.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(22,'Infectious diseases','Specializes in the diagnosis and treatment of infections caused by bacteria, viruses, fungi, and parasites.','Covers conditions like flu, HIV/AIDS, and bacterial infections.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(23,'Internal medicine','Provides comprehensive care for adults and manages complex medical conditions.','Addresses a wide range of illnesses, including chronic diseases and infections.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(24,'Laboratory medicine','Involves the analysis of medical specimens to aid in the diagnosis and treatment of diseases.','Includes pathology, clinical chemistry, and microbiology.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(25,'Maxillo-facial surgery','Specializes in surgical procedures involving the jaw, face, and neck.','Includes corrective jaw surgery, facial trauma repair, and dental implants.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(26,'Microbiology','Studies microorganisms, including bacteria, viruses, and fungi.','Applies to medical diagnostics, infectious diseases, and research.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(27,'Nephrology','Focuses on the diagnosis and treatment of kidney diseases and disorders.','Addresses conditions like chronic kidney disease, kidney stones, and hypertension.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(28,'Neuro-psychiatry','Integrates the fields of neurology and psychiatry to address disorders involving the nervous system and mental health.','Focuses on conditions like epilepsy, dementia, and mood disorders.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(29,'Neurology','Specializes in the diagnosis and treatment of disorders of the nervous system.','Covers conditions like Parkinson\'s disease, epilepsy, and multiple sclerosis.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(30,'Neurosurgery','Focuses on surgical procedures involving the nervous system.','Includes brain surgery, spinal surgery, and peripheral nerve surgery.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(31,'Nuclear medicine','Uses radioactive substances for diagnostic and therapeutic purposes.','Includes imaging studies to visualize organs and tissues at the molecular level.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(32,'Obstetrics and gynecology','Specializes in women\'s reproductive health, pregnancy, and childbirth.','Covers areas like prenatal care, gynecological surgery, and fertility treatments.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(33,'Occupational medicine','Focuses on the health and well-being of workers in the workplace.','Addresses work-related injuries, illnesses, and preventive measures.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(34,'Ophthalmology','Specializes in the diagnosis and treatment of eye disorders and diseases.','Covers conditions like cataracts, glaucoma, and refractive errors.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(35,'Orthopaedics','Focuses on the musculoskeletal system and treats conditions affecting bones, joints, muscles, and ligaments.','Includes orthopedic surgery, joint replacement, and sports medicine.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(36,'Otorhinolaryngology','Specializes in the diagnosis and treatment of disorders of the ears, nose, and throat (ENT).','Covers conditions like hearing loss, sinusitis, and tonsillitis.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(37,'Paediatric surgery','Focuses on surgical procedures for infants, children, and adolescents.','Includes procedures like pediatric hernia repair, congenital anomalies, and appendectomy.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(38,'Paediatrics','Specializes in the medical care of infants, children, and adolescents.','Addresses a wide range of pediatric health issues, including growth and development.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(39,'Pathology','Studies the nature and causes of diseases through laboratory examinations.','Involves the analysis of tissues, cells, and bodily fluids for diagnostic purposes.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(40,'Pharmacology','Focuses on the study of drugs and their effects on the body.','Includes drug development, interactions, and the use of medications for treatment.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(41,'Physical medicine and rehabilitation','Focuses on restoring function and improving quality of life through physical therapies.','Addresses conditions like musculoskeletal injuries, stroke, and spinal cord injuries.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(42,'Plastic surgery','Specializes in reconstructive and cosmetic surgical procedures.','Includes procedures like breast augmentation, facelifts, and rhinoplasty.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(43,'Podiatric Medicine','Focuses on the diagnosis and treatment of conditions affecting the feet and ankles.','Addresses issues like foot deformities, injuries, and diabetic foot care.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(44,'Podiatric Surgery','Specializes in surgical procedures for foot and ankle conditions.','Includes procedures like bunion surgery, tendon repair, and fracture fixation.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(45,'Psychiatry','Focuses on the diagnosis, treatment, and prevention of mental illnesses and disorders.','Involves therapies, medications, and counseling for mental health conditions.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(46,'Public health and Preventive Medicine','Focuses on preventing diseases and promoting health in communities.','Involves public health interventions, vaccinations, and health education.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(47,'Radiology','Uses medical imaging to diagnose and treat diseases.','Includes X-rays, CT scans, MRIs, and other imaging techniques.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(48,'Radiotherapy','Utilizes radiation to treat diseases, particularly cancer.','Involves targeted radiation therapy to destroy or control cancer cells.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(49,'Respiratory medicine','Specializes in the diagnosis and treatment of respiratory system disorders.','Addresses conditions such as asthma, COPD, and lung infections.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English'),(50,'Rheumatology','Focuses on the diagnosis and treatment of disorders affecting the joints and connective tissues.','Deals with conditions like arthritis, lupus, and other autoimmune diseases.','2023-12-13 18:26:24','2023-12-13 18:26:24',0,'English');
